import React, { useEffect, useState } from 'react';
import './dashboard.css';
import Sidebar from '../Sidebar/sidebar';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import Pagination from '../Pagination/paagination';
import { toast, ToastContainer } from 'react-toastify';


interface Order {
  id: number;
  customerName: string;
  orderId: number;
  totalQuantity: number;
  totalPrice: number;
}



function Dashboard() {
  const BASE_URL = process.env.REACT_APP_API_BASE_URL;

  const navigate = useNavigate();
  const [orders, setOrders] = useState<Order[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
    const [currentPage, setCurrentPage] = useState(1);
    const [itemsPerPage] = useState(4);



  useEffect(() => {
    const fetchOrders = async () => {
      try {
        const response = await axios.get(`${BASE_URL}orders`);
        setOrders(response.data);
      } catch (err) {
        setError('Error fetching orders');
      } finally {
        setLoading(false);
      }
    };

    fetchOrders();
  }, []);


  const handleDeleteClick = async (id: number) => {
    try {
      const response = await axios.delete(`${BASE_URL}orders/${id}`);
      if (response.status === 200) {
        setOrders(orders.filter(order => order.id !== id));
        toast.success(`Order delete successfully`)
      }
    } catch (error) {
      console.error('Error deleting order:', error);
    }
  };

  const indexOfLastItem = currentPage * itemsPerPage;
  const indexOfFirstItem = indexOfLastItem - itemsPerPage;
  const currentItems = orders.slice(indexOfFirstItem, indexOfLastItem);

  const paginate = (pageNumber: number) => setCurrentPage(pageNumber);


  return (
    <>
      <Sidebar />
      <ToastContainer position="top-right" autoClose={3000} />

      <div className={`container-fluid dashboard `}>
        <div className="row">
          <div className="col-md-2">

          </div>
          <div className="col-md-10">
            <span >
              <h1 className='' >Manage Orders</h1>
            </span>
            <div className="d-flex justify-content-end ">

              <button className="btn btn-primary " onClick={() => navigate('/order')}
              >New Order</button>
            </div>
            <div className="d-flex justify-content-center ">
              <span className='dataTable'>
                <table className="table table-bordered">
                  <thead>
                    <tr>
                      <th scope="col">Id</th>
                      <th scope="col">Customer Name</th>
                      <th scope="col">Order ID</th>
                      <th scope="col">Amount</th>
                      <th scope="col">Action</th>
                    </tr>
                  </thead>
                  <tbody>
                    {currentItems.map((order) => (
                      <tr key={order.id}>
                        <th scope="row">{order.id}</th>
                        <td>{order.customerName}</td>
                        <td>{order.orderId}</td>
                        <td>{order.totalPrice}</td>
                        <td>
                          <button className="btn" onClick={() => handleDeleteClick(order.id)}>
                            <i className="bi bi-trash"></i>
                          </button>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </span>

              <span className='fixed-pagination d-flex justify-content-center'>
                <Pagination
                  itemsPerPage={itemsPerPage}
                  totalItems={orders.length}
                  paginate={paginate}
                  currentPage={currentPage}
                />
              </span>


            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Dashboard;
